import React, { Component } from 'react';
import axios from 'axios';
import Tabledata from './Tabledata';

class Wbnx1 extends Component {
    state={
        data : [],
    }
    getdata = () =>{
        const data = axios.get('http://somweb.cf:8000/wbn-x2-ap1')
        .then((data) => {
            const mydata = data.data.data;
            console.log(mydata);
            return this.setState({data:mydata});
        }).catch(()=>{
            console.log('ERROR MESSAGE!');
        })
    }
    componentDidMount(){
        this.getdata();
    }
    render() {
        const data = this.State;
        return (
            <div className="table_1">
                <h1>Node Name : P0 : WBN_X1(eth0)</h1>
                <table className="table_1">
                    <thead>
                        <tr>
                            <th>Offset Peridod: 5 Mins</th>
                            <th colSpan="3">BandWidth(Mbps)</th>
                        </tr>
                    </thead>

                    <tbody>
                        <tr>
                            <td>offset</td>
                            <td>In</td>
                            <td>Out</td>
                            <td>Total</td>
                        </tr>
                    </tbody>
                    {data.map(data => (
                        <Tabledata 
                        key={data.offset}
                        offset={data.offset}
                        speed_in={data.speed_in}
                        speed_out={data.speed_out}
                        speed_total={data.speed_total}
                        />
                    ))}
                </table>
            </div>
        );
    }
}

export default Wbnx1;
